import React from 'react'
import { View, Text } from 'native-base'
import HomeSearch from '../Components/HomeSearch'

function HomeScreen() {
  return (
    <Box flex={1} bg={Colors.subGreen}>
        <HomeSearch/>
    </Box>
  );
}

export default HomeScreen;
